function UserData(props) {
    return (
        <div>
            {props.items.map((user) => (
                <table>
                    <tr>
                        <th>Date</th>
                        <th>Title</th>
                        <th>Amount</th>

                    </tr>
                    <tr>
                        <td>user.</td>
                        <td>{props.title}</td>
                        <td>{props.amount}</td>
                    </tr>

                </table>
            ))}

            {/* <div className="expense-item">
                <div>Date</div>
                <div className="expense-item__description">
                    <h2>{props.title}</h2>
                    <div className="expense-item__price">{props.amount}</div>
                </div>

            </div> */}
        </div>
    )
}

export default UserData;
